// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

contracts/RegisterFL.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RegisterFL{
    enum Role { Client, Server }

    struct User {
        address userAddress;
        uint256 registrationTime;
        Role role;
    }

    mapping(address => User) public users;
    uint256 public userCount;

    function register(Role role) public {
        // Determine if the user is new
        bool isNewUser = users[msg.sender].userAddress == address(0);

        // Update user details with the latest registration info
        users[msg.sender] = User({
            userAddress: msg.sender,
            registrationTime: block.timestamp,
            role: role
        });

        // Increment the user count only if it's a new user
        if (isNewUser) {
            userCount++;
        }
    }

    function isRegistered(address user) public view returns (bool) {
        return users[user].userAddress != address(0);
    }

    function getUserRole(address user) public view returns (Role) {
        require(isRegistered(user), "User not registered");
        return users[user].role;
    }
}

